# 10. Машина в течение срока службы приносит годовой доход в размере 200 000 руб.<br>
# Сама она стоит 1 000 000 руб. в момент покупки и продается за 250 000 руб.<br>
# при утилизации. Вложив ту же сумму в другие инвестиционные инструменты,<br>
# можно заработать 8 % годовых. Каков минимальный срок службы машины, при<br>
# котором она станет более привлекательной по сравнению с альтернативными инвестициями?

# +
car_price = 1000000  # начальная стоимость машины
resale_price = 250000  # стоимость при продаже
annual_income = 200000  # годовой доход от машины
rate = 0.08  # процент альтернативных инвестиций
n_value = 0

while True:
    # доход от машины
    car_income = annual_income * n_value + resale_price

    # доход от альтернативных инвестиций
    investment_income = car_price * (1 + rate) ** n_value

    if car_income > investment_income:
        break

    n_value += 1  # счетчик лет

print("Минимальный срок службы машины:", n_value, "лет")
